const login = [
    {
    emailid:'arunakil12@gmail.com',
    names:'arun',
    Numbers:9080371821,
    dno:12,
    street:'km street',
    city:"pollachi",
    pincode:642114

    }

]

const Loginreducer = (state = login, action ) => {
    switch(action.type){
        case " LOG_IN":
            return state;
        default:
            return state;    
    }
}

export default Loginreducer;
